function my_get_ticket_booked_spaces( $booked_spaces, $EM_Ticket ){
	global $wpdb;
	$table_name   = $wpdb->prefix.'em_tickets_bookings';
	$booked_spaces = $wpdb->get_var('SELECT SUM(ticket_booking_spaces) AS booked_space FROM '.$table_name.' WHERE ticket_id='. absint($EM_Ticket->ticket_id) .' GROUP BY ticket_id');	
	return $booked_spaces;
}
add_filter('em_ticket_get_booked_spaces', 'my_get_ticket_booked_spaces', 100, 2 );

# Dieses Skript komprimiert alle markierten .mp4-Dateien √ºber das Kontextmen√º per FFmpeg mit einem w√§hlbaren CRF-Wert wahlweise als H.265 oder AV1. Der urspr√ºngliche Zeitstempel (√Ñnderungsdatum) der Datei wird im Nachhinein neu gesetzt, und die Ausgabedateien erhalten angepasste Namen (_crfXX.mp4 bzw. mit AV1 _AV1_crfXX.mp4). Bei Videos, die von einer DJI Action Kamera oder der DJI Mimo App stammen, wird automatisch das Datum aus dem Dateinamen verwendet, unabh√§ngig von dem √Ñnderungsdatum. Zus√§tzlich wird die Zeitzone aus der Abfrage ber√ºcksichtigt.

# Verwendung des Scripts:

# Script als "video_compress.ps1" mit Kodierung "UTF-8-BOM" anlegen.
# "ffmpeg-release-essentials.zip" hier herunterladen, entpacken und aus dem Ordner "bin" die ffmpeg.exe und ffprobe.exe in das Verzeichnis $ToolDir (Hier im Script im Bereich "PFAD HIER ANPASSEN" definiert) kopieren: https://www.gyan.dev/ffmpeg/builds/
# "exiftool-XXX.zip" hier herunterladen, entpacken, in das Verzeichnis $ToolDir kopieren und die .exe-Datei umbenennen in "exiftool.exe": https://exiftool.org/
# REG-Datei mit Endung ".reg" erstellen: https://pastebin.com/V4sn7Mqc
# Pfade in der REG-Datei anpassen, wo "video_compress.ps1" liegt
# Datei doppelklicken und alles bejahen

# Version 1.0.2 - 15.01.2026 - @nurjns

param (
	[string]$FilePath,
	[int]$CRF = 25,
	[string]$Codec = 'HEVC'
)

# PFAD HIER ANPASSEN
$ToolDir = 'X:\PFAD\ZU\assets'

$FFmpeg = Join-Path $ToolDir 'ffmpeg.exe'
$FFprobe = Join-Path $ToolDir 'ffprobe.exe'
$ExifTool = Join-Path $ToolDir 'exiftool.exe'

Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing

# --- Pr√ºfung auf Existenz der Tools ---
$MissingTools = @()
foreach ($Tool in @($FFmpeg, $FFprobe, $ExifTool)) {
	if (-not (Test-Path -LiteralPath $Tool)) {
		$MissingTools += $Tool
	}
}

if ($MissingTools.Count -gt 0) {
	$Message = "Folgende Tools wurden nicht gefunden:`n`n" + ($MissingTools -join "`n")
	[System.Windows.Forms.MessageBox]::Show($Message, 'Fehler: Tools fehlen', [System.Windows.Forms.MessageBoxButtons]::OK, [System.Windows.Forms.MessageBoxIcon]::Error)
	exit
}

function Get-ExifTag {
	param([string]$Tag, [string]$Path)
	$val = & $ExifTool -s3 -api 'QuickTimeUTC' $Tag $Path | Out-String
	return $val.Trim()
}

# --- 1. Datei-Check ---
$File = Get-Item -LiteralPath $FilePath
$BaseName = $File.BaseName

if ($Codec -eq 'AV1') {
	$Suffix = "_AV1_crf$CRF"
	if ($CRF -le 20) { $CpuUsed = 2 }
	elseif ($CRF -le 28) { $CpuUsed = 4 }
	elseif ($CRF -le 35) { $CpuUsed = 6 }
	else { $CpuUsed = 8 }
	$VArgs = "-c:v libaom-av1 -crf $CRF -cpu-used $CpuUsed -pix_fmt yuv420p"
} else {
	$Suffix = "_crf$CRF"
	$VArgs = "-c:v libx265 -crf $CRF -preset slow -pix_fmt yuv420p -tag:v hvc1"
}

$OutFile = Join-Path $File.DirectoryName ($BaseName + $Suffix + '.mp4')

if ($File.BaseName -match '(_crf\d+|_AV1_crf\d+)$') {
	[System.Windows.Forms.MessageBox]::Show('Ignoriert: ' + $File.Name + ' ist bereits ein verarbeitetes Video.', 'Info')
	exit
}

if (Test-Path -LiteralPath $OutFile) {
	[System.Windows.Forms.MessageBox]::Show("Ignoriert: Die Datei existiert bereits:`n$OutFile", 'Info')
	exit
}

# --- 2. Frame-Analyse ---
$TotalFramesRaw = & $FFprobe -v error -select_streams v:0 -count_packets -show_entries stream=nb_read_packets -of csv=p=0 "$FilePath"
$TotalFrames = 0

if (-not [string]::IsNullOrWhiteSpace($TotalFramesRaw) -and $TotalFramesRaw -match '^\d+$') {
	$TotalFrames = [int]$TotalFramesRaw
}

# Fallback: Dauer * FPS
if ($TotalFrames -le 0) {
	$Duration = & $FFprobe -v error -select_streams v:0 -show_entries format=duration -of default=nokey=1:noprint_wrappers=1 "$FilePath"
	$FPSRaw = & $FFprobe -v error -select_streams v:0 -show_entries stream=avg_frame_rate -of default=nokey=1:noprint_wrappers=1 "$FilePath"
	if ($FPSRaw -match '(\d+)/(\d+)') {
		$FPS = [double]$matches[1] / [double]$matches[2]
		$TotalFrames = [math]::Ceiling([double]$Duration.Replace(',', '.') * $FPS)
	}
}

# --- 3. GUI Setup ---
$Form = New-Object System.Windows.Forms.Form
$Form.Text = 'Video Compressor - 1.0.2 @nurjns'
$Form.Size = New-Object System.Drawing.Size(450, 160)
$Form.StartPosition = 'CenterScreen'
$Form.FormBorderStyle = 'FixedDialog'
$Form.MaximizeBox = $false
$Form.TopMost = $false

$Label = New-Object System.Windows.Forms.Label
$Label.Location = New-Object System.Drawing.Point(15, 20)
$Label.Size = New-Object System.Drawing.Size(400, 40)
$Label.Text = 'Vorbereitung...'

$ProgressBar = New-Object System.Windows.Forms.ProgressBar
$ProgressBar.Location = New-Object System.Drawing.Point(15, 70)
$ProgressBar.Size = New-Object System.Drawing.Size(400, 23)

if ($TotalFrames -gt 0) {
	$ProgressBar.Style = 'Continuous'
	$ProgressBar.Minimum = 0
	$ProgressBar.Maximum = $TotalFrames
} else {
	$ProgressBar.Style = 'Marquee'
	$ProgressBar.MarqueeAnimationSpeed = 30
}

$Form.Controls.AddRange(@($Label, $ProgressBar))

# --- 4. Metadaten-Logik ---
$Offset = Get-ExifTag '-OffsetTimeOriginal' "$FilePath"
if ([string]::IsNullOrWhiteSpace($Offset)) { $Offset = Get-ExifTag '-OffsetTime' "$FilePath" }
if ([string]::IsNullOrWhiteSpace($Offset)) {
	$TZ = [System.TimeZoneInfo]::FindSystemTimeZoneById('W. Europe Standard Time')
	$Offset = if ($TZ.IsDaylightSavingTime((Get-Date))) { '+02:00' } else { '+01:00' }
}

$Timestamp = ''
if ($BaseName -match '^DJI_(\d{14})_') {
	$dt = $Matches[1]
	$Timestamp = $dt.Substring(0,4) + ':' + $dt.Substring(4,2) + ':' + $dt.Substring(6,2) + ' ' + $dt.Substring(8,2) + ':' + $dt.Substring(10,2) + ':' + $dt.Substring(12,2)
} elseif ($BaseName -match 'dji_mimo_(\d{8})_(\d{6})') {
	$d = $Matches[1]; $t = $Matches[2]
	$Timestamp = $d.Substring(0,4) + ':' + $d.Substring(4,2) + ':' + $d.Substring(6,2) + ' ' + $t.Substring(0,2) + ':' + $t.Substring(2,2) + ':' + $t.Substring(4,2)
} else {
	$Timestamp = Get-ExifTag '-CreateDate' "$FilePath"
	if ([string]::IsNullOrWhiteSpace($Timestamp) -or $Timestamp -eq '0000:00:00 00:00:00') {
		$Timestamp = $File.LastWriteTime.ToString('yyyy:MM:dd HH:mm:ss')
	}
}

# --- 5. Prozess-Start ---
$Form.Add_Shown({
	$Label.Text = "Encoding l√§uft ($Codec)...`nCRF: $CRF"

	$StartInfo = New-Object System.Diagnostics.ProcessStartInfo
	$StartInfo.FileName = $FFmpeg
	$StartInfo.Arguments = "-y -i `"$FilePath`" $VArgs -movflags +faststart -c:a aac -b:a 160k `"$OutFile`""
	$StartInfo.RedirectStandardError = $true
	$StartInfo.UseShellExecute = $false
	$StartInfo.CreateNoWindow = $true

	$Process = [System.Diagnostics.Process]::Start($StartInfo)

	while (-not $Process.HasExited) {
		$Line = $Process.StandardError.ReadLine()
		if ($Line -match 'frame=\s*(\d+)') {
			$CurrentFrame = [int]$Matches[1]
			if ($TotalFrames -gt 0 -and $CurrentFrame -le $TotalFrames) {
				$ProgressBar.Value = $CurrentFrame
				$Percent = [math]::Round(($CurrentFrame / $TotalFrames) * 100)
				$Label.Text = "Encoding: $Percent% ($CurrentFrame / $TotalFrames Frames)`nCodec: $Codec | CRF: $CRF"
			}
		}
		[System.Windows.Forms.Application]::DoEvents()
	}

	if ($Process.ExitCode -eq 0) {
		if ($ProgressBar.Style -eq 'Continuous') { $ProgressBar.Value = $TotalFrames }
		$Label.Text = 'Schreibe Metadaten...'
		[System.Windows.Forms.Application]::DoEvents()

		$ExifArgs = @(
			'-overwrite_original',
			"-DateTimeOriginal=$Timestamp$Offset",
			"-OffsetTimeOriginal=$Offset",
			"-FileModifyDate=$Timestamp",
			$OutFile
		)
		& $ExifTool $ExifArgs | Out-Null

		$Label.Text = 'Kodierung erfolgreich!'
		[console]::Beep(500, 200)
		Start-Sleep -Seconds 2
	} else {
		[System.Windows.Forms.MessageBox]::Show('Fehler beim Encoding! ExitCode: ' + $Process.ExitCode, 'Fehler')
		[console]::Beep(200, 200)
	}
	$Form.Close()
})

$Form.ShowDialog()

